import styled from "styled-components";

export const Heading = styled.div`
  @media screen and (min-width: 320px) {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;

    color: black;
    font-size: 1.4em;
  }
`;
